import './App.css';
import Logo from './components/logo/Logo.js';
import Particles from './components/particles/Particles'
import Cards from './components/cards/Cards.js'
import Data from "./components/data/Data"

const launches = [
  {
      id: 1,
      rocket: "",
      misionName: "",
      time: ""
  },
  {
      id: 2,
      rocket: "",
      misionName: "",
      time: ""
  },
  {
      id: 3,
      rocket: "",
      misionName: "",
      time: ""
  }
];

function App() {

  const launchesData = Data()
  console.log(launchesData)
  var cont = 0
  launchesData.forEach(launch => {
    launches[cont].rocket = ""
    cont++
  })

  return (
    <div className="App">
      <header className='center'>
        <Logo />
      </header>
      <div className="body">
        <div className="bg">
          <Particles className="particles" id="DATO FREAK: El color de las particulas se llama COSMIC LATTE, representa el color promedio del universo."/>
        </div>
        <div className="tarjetas">
          <Cards data={launches} />
        </div>
      </div>
    </div>
  );
}

export default App;
